- input: "TEXT\x1CC00554535\x1C.TEXT\x1C\x1CF3XN\x1CPlease note: The Committee has
    demostrated the necessary steps to establish best efforts to obtain and disclose
    the full identification of all individuals who contribute in exess of $200 in
    a calendar year.These efforts include a clear request with the original solicitation,
    followd by a Request for Missing Information Letter, which clearly asks for the
    missing information, without soliciting a contribution. In addition, the letter
    reads: Federal law requires us to make our best efforts to collect and report
    the name, mailing address, occupation and name of employer for individuals who
    contribute in excess of $200 in a calendar year. We then enclose a self-address
    envelope and include a telephone number to reach the committee with any questions.\n"
